create table CountryRenewableEnergySource (
    id int auto_increment primary key,
    countryId int not null,
    renewableEnergySourceId int not null,
    yearId int not null,
    amount int default 0 null,
    constraint CountryRenewableEnergySource_ibfk_1 foreign key (renewableEnergySourceId) references RenewableEnergySource (id),
    constraint CountryRenewableEnergySource_ibfk_2 foreign key (countryId) references Country (id),
    constraint CountryRenewableEnergySource_ibfk_3 foreign key (yearId) references Year (id)
);

create index countryId on CountryRenewableEnergySource (countryId);

create index renewableEnergySourceId on CountryRenewableEnergySource (renewableEnergySourceId);

create index yearId on CountryRenewableEnergySource (yearId);

